import React, { useState } from 'react';
import Login from '../components/Login';
import Register from '../components/Register';

const Home = () => {
  const [showLogin, setShowLogin] = useState(true);

  const handleToggle = () => {
    setShowLogin(!showLogin);
  };

  return (
    <div>
      <h1>Welcome to Tinder Clone</h1>
      
      {showLogin ? (
        <>
          <Login />
        </>
      ) : (
        <div>
          <Register />
        </div>
      )}
    </div>
  );
};

export default Home;
